import React from "react";
import "../styles/MapSVG.css";

const locations = {
  "A Coruña": { x: 120, y: 50 },
  "Vigo": { x: 70, y: 200 },
  "Pontevedra": { x: 90, y: 180 },
  "Ourense": { x: 140, y: 230 },
  "Lugo": { x: 150, y: 80 },
  "Santiago de Compostela": { x: 130, y: 120 }
};

const MapSVG = () => {
  return <img src="../styles/img" alt="Mapa de Galicia" className="map-image" />;
};


export default MapSVG;
